import "./style.css";
import { ButtonGray } from "../ButtonGray";

export const FinancialSummary = () => {
  return (
    <section className="flex-resume ">
      <p>Resumo financeiro</p>
      <div className="flex-buttons width-resume">
        <ButtonGray description={"Todos"} />
        <ButtonGray description={"Entradas"} />
        <ButtonGray description={"Saídas"} />
      </div>
    </section>
  );
};
